import React from 'react';
import {
  HeaderContainer,
  Header,
  SkipToContent,
  HeaderName,
  HeaderNavigation,
  HeaderMenuItem,
  HeaderGlobalBar,
  HeaderGlobalAction,
  SideNav,
  SideNavItems,
  SideNavLink,
  SideNavMenu,
  SideNavMenuItem,
  Breadcrumb,
  BreadcrumbItem,
  Button,
  Tabs,
  Tab,
} from 'carbon-components-react';

const props = {
  tabs: {
    selected: 0,
    role: 'navigation',
  },
  tab: {
    role: 'presentation',
    tabIndex: 0,
  },
};


const PzHeader = () => {
  return (
  <div>

    <HeaderContainer
      render={({ isSideNavExpanded, onClickSideNavExpand }) => (
        <Header aria-label="Phase Zero Consulting">
          
          {/*SkipToContent is for web based screen readers    */}
          <SkipToContent />

          {/* Header site name component*/}
          <HeaderName href="/phasezeroHome" prefix="">
            Phase Zero
          </HeaderName>

          {/*Header Navigation component with 'HeaderMenuItem for each navigation link*/}
          <HeaderNavigation aria-label="Data Collection Platform">
            <HeaderMenuItem>Home</HeaderMenuItem>
            <HeaderMenuItem>Setup</HeaderMenuItem>
            <HeaderMenuItem>Organisation</HeaderMenuItem>
            <HeaderMenuItem>Practitioner</HeaderMenuItem>
            <HeaderMenuItem>Dashboard</HeaderMenuItem>
            <HeaderMenuItem>Data & Analytics</HeaderMenuItem>
          </HeaderNavigation>
 

          {/* 
              Left Side Navigation component which is actually tied in with the overall Header component
          */}
          <SideNav aria-label="Side navigation" isRail>
            <SideNavItems className="black">
              <SideNavLink>Home</SideNavLink>
              <SideNavLink>User Dashboard</SideNavLink>
              <SideNavLink>Now you see it</SideNavLink>
              <SideNavLink>Now you dont</SideNavLink>

              <SideNavMenu>
                <SideNavMenuItem href="#">Item</SideNavMenuItem>
              </SideNavMenu>

              <SideNavMenu>
                <SideNavMenuItem href="#">Item</SideNavMenuItem>
              </SideNavMenu>

              <SideNavMenu>
                <SideNavMenuItem href="#">Item</SideNavMenuItem>
                <SideNavMenuItem href="#">Item</SideNavMenuItem>
              </SideNavMenu>
            </SideNavItems>
          </SideNav>
        </Header>
      )}
    />
  </div>
  );
};
 
export default PzHeader;
